import React from 'react';
import { Link } from 'react-router-dom';
import './Loin.css'; // CSS externo con los estilos de tu <style>

function LoginPage() {
  return (
    <>
     
      {/* Login container */}
      <div className="login-container">
        <img src="img/JobQuest.png" alt="JobQuest" className="login-image" />
        <h2 className="login-title">Acceso a Entrevista</h2>
        <p>Para acceder a la entrevista, necesitas iniciar sesión o registrarte.</p>
        <p className="mb-4">Por favor, elige una de las siguientes opciones:</p>

        <div className="message">¿Ya tienes una cuenta?</div>
        <Link to="/login" className="btn btn-primary mb-2">Iniciar Sesión</Link>

        <div className="message">¿No tienes cuenta?</div>
        <Link to="/registro" className="btn btn-primary">Registrarse</Link>
      </div>
    </>
  );
}

export default LoginPage;
